import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal by clicking on the cart element (using text selector)
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal to appear (look for cart modal by heading)
    await page.waitForSelector('text=Your cart', { timeout: 5000 }).catch(() => {});
    // Or fallback: look for cart modal by class
    await page.waitForSelector('.cart-content', { timeout: 5000 });

    // Take screenshot after opening cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for at least one "Remove" button to appear (using button text)
    const removeButton = await page.waitForSelector('button:has-text("Remove")', { timeout: 5000 });

    // Extract the cart item title before removal for verification
    let cartItemTitle = '';
    try {
      const cartItemTitleEl = await page.$('.cart-item-title');
      if (cartItemTitleEl) {
        cartItemTitle = await cartItemTitleEl.textContent();
      }
    } catch {}

    // Click the first "Remove" button
    await removeButton.click();

    // Wait for the cart to update (either "Your cart is empty" or the item disappears)
    await page.waitForTimeout(500); // Small pause for UI update

    // Take screenshot after removing item
    const step3 = path.join(screenshotsDir, 'step_3_item_removed.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart status after removal
    let cartStatus = '';
    try {
      const emptyCartEl = await page.$('.empty-cart');
      if (emptyCartEl) {
        cartStatus = await emptyCartEl.textContent();
      } else {
        // If not empty, get remaining cart item titles
        const titles = await page.$$eval('.cart-item-title', els => els.map(e => e.textContent));
        cartStatus = titles.join('; ');
      }
    } catch {}

    return {
      success: true,
      action: "Removed an item from the cart using the Remove button in the cart modal",
      extractedData: {
        removedItemTitle: cartItemTitle.trim(),
        cartStatus: cartStatus.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
